import React from "react";
import './Navbar.css';

const Navbar = () => {
    return (

        <nav className="Navbar">
        <div className="logo">
            <img src=".png" alt="search-icon"></img>
        </div>
        <ul class="menu">
            <li><a href="#">Sign Up</a></li>
        </ul>
        <div class="buttons">
            <button class="btn btn-secondary">Secondary</button>
        </div>
    </nav>




    );










};

export default Navbar;
